import "./App.css"
import NavBar from "./components/NavBar/NavBar";
import Login from "./components/login/login"
import { BrowserRouter, Route, Redirect, Switch } from "react-router-dom";


function App() {
  return (
    <div className="App">
      <NavBar></NavBar>
      <BrowserRouter>
      <Route path="/login" component={Login}></Route>
      </BrowserRouter>
    </div>
  );
}

export default App;
